import React from "react";
import { Menu } from "antd";

import "../../App.css"
import { CodeOutlined, HomeOutlined, RedoOutlined } from "@ant-design/icons";

function Navbar() {
	return (
		<div>

			<Menu className="Navbar"
				items={[
					{ label: 'Home', icon: <HomeOutlined /> },
					{ label: 'Automaten Generieren', icon: <RedoOutlined /> },
					{ label: 'RISC-V Befehle', icon: <CodeOutlined /> },
					{ label: 'Pipeline Konflikte' },
					{ label: 'BDD Generator' },
					{ label: 'AIG Generator' },
					{ label: 'SAT Solver' },
					{ label: 'Kontakt' },
				]}>

			</Menu>
		</div>

	)
}

export default Navbar
